function euler8() {
	var numArry = "".split("");
	var greatProduct = 0;
	var product = 0;
	for (i = 0; i < 987; i++) {
		product = numArry[i]   * numArry[i+1] * numArry[i+2] * numArry[i+3] *
							numArry[i+4] * numArry[i+5] * numArry[i+6] * numArry[i+7] *
							numArry[i+8] * numArry[i+9] * numArry[i+10] * numArry[i+11] *
							numArry[i+12]
		if (product > greatProduct) {
			greatProduct = product;
		}
	};
	return greatProduct
};
euler8();